import styled from "styled-components";

export const Button = styled.button`
    background: transparent;
    border-radius: 3px;
    border: 2px solid palevioletred;
    color: palevioletred;
    margin: 0 1em;
    padding: 0.25em 1em;`;

export const AdderComponent = styled.div`
      display: flex;
    max-width: 150px;
    flex-wrap: wrap;
    justify-content: center;
    border: 1px solid;
    margin: 10px;
    padding: 10px;
    `;
